import { Component } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { Member } from 'src/app/entity/member';
import { MemberService } from 'src/app/services/member.service';

@Component({
  selector: 'app-show-member',
  templateUrl: './show-member.component.html',
  styleUrls: ['./show-member.component.css']
})
export class ShowMemberComponent {

  memberData: Member[] = [];


  constructor(private adminMemberService: MemberService, private router: Router, private activeRoute: ActivatedRoute, pro) { }
  private adminName = ""

  ngOnInit(): void {

    if (this.adminName.length <= 0) {
      alert("Your Are not Known to me login as admin")
      this.router.navigate(['admin'])
    }
    else {
      this.adminMemberService.getAllMember().subscribe({
        next: (value) => {
          this.memberData = value
          console.log(value)
        },
        error: (err) => {
          console.log(err)
        },
      })
    }
  }


  goBack() { 
    this.router.navigate(['adminView'])
  }
}
